function cssToJs(a,b){let c=a.split(";");for(let d=0;d<c.length;d++)c[d]=c[d].replace(/\s/g,""),""===c[d]&&c.splice(d,1);for(let d=0;d<c.length;d++){let a=c[d].split(":"),e=a[0].split("-");if(1<e.length){for(let a=1;a<e.length;a++)e[a]=e[a].charAt(0).toUpperCase()+e[a].slice(1);e.join("")}else{a[0]}b.style[e[0]]=a[1]}}